CREATE DATABASE `db_misc`;

USE `db_misc`;

CREATE TABLE `file_record` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `file_name` varchar(128) NOT NULL DEFAULT '' COMMENT '文件名称',
  `target` varchar(128) NOT NULL DEFAULT '' COMMENT 'HTTP接口，或FTP文件存放路径',
  `status` tinyint unsigned NOT NULL DEFAULT 0 COMMENT '状态(0：上传成功，1：上传失败，2：正在解析，3: 解析成功，4：解析失败)',
  `remark` varchar(128) NOT NULL DEFAULT '' COMMENT '备注',
  `user_id` int unsigned NOT NULL DEFAULT 0 COMMENT '操作人ID',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='文件记录';

CREATE TABLE `tag_category` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `pid` int unsigned NOT NULL DEFAULT 0 COMMENT '父节点id(根节点的父ID为0）',
  `pids` varchar(255) NOT NULL DEFAULT '' COMMENT '所有父节点ID，逗号分隔，从根节点到子节点有序',
  `title` varchar(64) NOT NULL DEFAULT '' COMMENT '分类名称',
  `remark` varchar(255) NOT NULL DEFAULT '' COMMENT '备注',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='标签分类';

CREATE TABLE `tag` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(64) NOT NULL DEFAULT '' COMMENT '标签名称',
  `category_id` int unsigned NOT NULL DEFAULT 0 COMMENT '标签分类ID',
  `remark` varchar(255) NOT NULL DEFAULT '' COMMENT '备注',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  KEY `idx_tag_categoryid` (`category_id`),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='标签';

CREATE TABLE `tag_record` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `tag_id` int unsigned NOT NULL DEFAULT 0 COMMENT '标签ID',
  `object_type` tinyint unsigned NOT NULL DEFAULT 0 COMMENT '对象类型',
  `object_value` varchar(100) NOT NULL DEFAULT '' COMMENT '对象值',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  UNIQUE KEY `uk_tagrecord_objecttype_objectvalue_tagid` (`object_type`, `object_value`, `tag_id`),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='标签记录';

CREATE TABLE `dict_data` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `type` varchar(128) NOT NULL DEFAULT '' COMMENT '字典类型',
  `label` varchar(64) NOT NULL DEFAULT '' COMMENT '字典标签',
  `value` varchar(64) NOT NULL DEFAULT '' COMMENT '字典值',
  `sort` int unsigned NOT NULL DEFAULT 0 COMMENT '排序',
  `remark` varchar(255) NOT NULL DEFAULT '' COMMENT '备注',
  `status` tinyint unsigned NOT NULL DEFAULT 1 COMMENT '1 启用，0 停用',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  KEY `idx_dictdata_type` (`type`),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='字典数据';

CREATE TABLE `dict_type` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(64) NOT NULL DEFAULT '' COMMENT '类型名称',
  `value` varchar(128) NOT NULL DEFAULT '' COMMENT '类型值',
  `remark` varchar(255) NOT NULL DEFAULT '' COMMENT '备注',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_dicttype_value` (`value`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='字典类型';

CREATE TABLE `region` (
  `id` int unsigned NOT NULL,
  `name` varchar(32) NOT NULL DEFAULT '' COMMENT '地区名称',
  `code` varchar(16) NOT NULL DEFAULT '' COMMENT '地区编码',
  `status` tinyint unsigned NOT NULL DEFAULT 1 COMMENT '状态',
  `pid` int unsigned NOT NULL DEFAULT 0 COMMENT '父节点id(根节点的父ID为0）',
  `pids` varchar(255) NOT NULL DEFAULT '' COMMENT '所有父节点ID，逗号分隔，从根节点到子节点有序',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `idx_region_pid` (`pid`),
  UNIQUE KEY `uk_region_code` (`code`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='地区';

